"""
462. Minimum Moves to Equal Array Elements II   Medium

Given a non-empty integer array, find the minimum number of moves required to make all array elements equal, where a move is incrementing a selected element by 1 or decrementing a selected element by 1.

You may assume the array's length is at most 10,000.

Example:

Input:
[1,2,3]

Output:
2

Explanation:
Only two moves are needed (remember each move increments or decrements one element):

[1,2,3]  =>  [2,2,3]  =>  [2,2,2]
"""

class Solution(object):
    def minMoves2(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        length = len(nums)
        #mid = self.findKthSmallest(nums, int(length / 2))
        self.buildHeap(nums, length)

        for i in range(int((length + 1) / 2) - 1):
            nums[0], nums[length - 1 - i] = nums[length - 1 - i], nums[0]
            self.heapify(nums, 0, length - 1 - i)
        mid = nums[0]
        result = 0
        for num in nums:
            result += abs(num - mid)
        return result

    def heapify(self, nums, index, length):
        if index >= length:
            return

        left = 2 * index + 1
        right = 2 * index + 2
        maxIndex = index

        if left < length and nums[left] > nums[maxIndex]:
            maxIndex = left

        if right < length and nums[right] > nums[maxIndex]:
            maxIndex = right
        
        if index != maxIndex:
            nums[index], nums[maxIndex] = nums[maxIndex], nums[index]
            self.heapify(nums, maxIndex, length)
        
    def buildHeap(self, nums, length):
        lastNode = length - 1
        start = int((lastNode - 1) / 2)

        while start >= 0:
            self.heapify(nums, start, length)
            start -= 1
        
    def findKthSmallest(self, arr, k):
        l = 0
        h = len(arr) - 1
        while l < h:
            pivot = self.partition(arr, l, h)
            if pivot == k:
                break
            if pivot < k:
                l = pivot + 1
            else:
                h = pivot - 1
        return arr[k]

    def partition(self, arr, l, h):
        i = l + 1
        j = h
        pivot = arr[l]
        while True:
            while i < h and arr[i] < pivot:
                i += 1
            while j > l and arr[j] > pivot:
                j -= 1
            if i >= j:
                break
            arr[i], arr[j] = arr[j], arr[i]
            i += 1
            j -= 1
        arr[l], arr[j] = arr[j], arr[l]
        return j
    


